  const [pass, setPass] = useState('');
  return (
    <div className="pageContainer">
      <div className="left-section">
        <div className="grad"></div>
        <img src="/logo.png"></img>

        <LoginPage 
         email={email}
         pass={pass} 
         setEmail={setEmail}
         setPass={setPass}/>
    /</div>
    </div>
  )
}
